node.text:
Self-belief is not arrogance. I don't know who put it in your head that people must think small of themselves in order to be perceived as humble, but it's bullshit. You're arrogant when you think you're intrinsically worth more than another person. When you're confident that your abilities can achieve the results you envision, you have self-belief. Don't shrink yourself so others around you feel okay around you. It doesn't help anyone.

